// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RefactoredToken {
    string public name = "RefactoredToken";
    string public symbol = "RFT";
    uint8 public decimals = 18;
    uint256 public totalSupply;

    mapping(address => uint256) private balances;
    mapping(address => mapping(address => uint256)) private allowances;

    address public uniPairAddress;
    uint256 public maxTransferAmount;
    uint256 public maxTransactionSize;
    bool public tradingEnabled;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    modifier onlyWhenTradingEnabled() {
        require(tradingEnabled, "Trading is not enabled");
        _;
    }

    modifier validRecipient(address recipient) {
        require(recipient != address(0), "Transfer to the zero address");
        _;
    }

    modifier withinTransferLimits(uint256 amount) {
        require(amount <= maxTransferAmount, "Transfer amount exceeds the maximum limit");
        _;
    }

    constructor(uint256 _initialSupply, uint256 _maxTransferAmount, uint256 _maxTransactionSize) {
        totalSupply = _initialSupply * (10 ** uint256(decimals));
        balances[msg.sender] = totalSupply;
        maxTransferAmount = _maxTransferAmount;
        maxTransactionSize = _maxTransactionSize;
        tradingEnabled = true;

        emit Transfer(address(0), msg.sender, totalSupply);
    }

    function balanceOf(address account) public view returns (uint256) {
        return balances[account];
    }

    function transfer(address recipient, uint256 amount)
        public
        onlyWhenTradingEnabled
        validRecipient(recipient)
        withinTransferLimits(amount)
